import "./App.css";
import "./styles.css";
import React from "react";
import { Slide } from "react-slideshow-image";
import "react-slideshow-image/dist/styles.css";
import Recommendation from "./Recommendation.js";
import AnchorLink from "react-anchor-link-smooth-scroll";

function App() {
  return (
    <div className="App">
      <Header />
      <MangaPreview />
      <p>My Recommendation Settings➡️</p>;
      <AnchorLink href="#reco" style={{ float: "left", color: "white" }}>
        Recommended For You
      </AnchorLink>
      <a href="App.js" style={{ float: "left", color: "white" }}>
        Sop's Picks ✌️
      </a>
      <Recommendation />
      <SopReco />

      <Footer />
    </div>
  );
}

function Header() {
  return (
    <div className="menu">
      <div className="logo">
        <img src="lezhin.png" alt="Lezhin Logo"></img>
      </div>
      <div className="menu-div">
        <ul>
          <button className="btn2">RECENT</button>
          <button className="btn2">SUBSCRIBED</button>
          <button className="btn2">DOWNLOADS</button>
          <button className="btn2">UNLOCKED</button>
          <button className="btn2">CREATORS</button>
          <button className="btn2">COMMENTS</button>
        </ul>
      </div>
      <div className="right-nav">
        <div className="payment"></div>
        <div className="search"></div>
      </div>
    </div>
  );
}

const MangaPreview = () => {
  const image = ["solo.jpg", "boxer.png", "horizon.png", "windbreaker.png"];

  return (
    <Slide>
      <div className="each-slide-effect">
        <div style={{ backgroundImage: `url(${image[0]})` }}></div>
      </div>
      <div className="each-slide-effect">
        <div style={{ backgroundImage: `url(${image[1]})` }}></div>
      </div>
      <div className="each-slide-effect">
        <div style={{ backgroundImage: `url(${image[2]})` }}></div>
      </div>
      <div className="each-slide-effect">
        <div style={{ backgroundImage: `url(${image[3]})` }}></div>
      </div>
    </Slide>
  );
};

const SopReco = () => {
  const image = [
    "sops/horizon.png",
    "sops/MLS.png",
    "sops/getschooled.png",
    "sops/silenthorror.png",
    "sops/everything.png",
    "sops/reve.png",
  ];

  return (
    <Slide>
      <div className="each-slide-effect">
        <div style={{ backgroundImage: `url(${image[0]})` }}>
          <h1 style={{ color: "white" }}>The Horizon</h1>
        </div>
      </div>

      <div className="each-slide-effect">
        <div style={{ backgroundImage: `url(${image[1]})` }}>
          <h1 style={{ color: "white" }}>My Lucky Strike</h1>
        </div>
      </div>

      <div className="each-slide-effect">
        <div style={{ backgroundImage: `url(${image[2]})` }}>
          <h1>Get Schooled</h1>
        </div>
      </div>

      <div className="each-slide-effect">
        <div style={{ backgroundImage: `url(${image[3]})` }}>
          <h1>Silent Horror</h1>
        </div>
      </div>

      <div className="each-slide-effect">
        <div style={{ backgroundImage: `url(${image[4]})` }}>
          <h1>Everything is Fine</h1>
        </div>
      </div>
      <div className="each-slide-effect">
        <div style={{ backgroundImage: `url(${image[5]})` }}>
          <h1>Revelation of Youth</h1>
        </div>
      </div>
    </Slide>
  );
};

function MReco2() {
  return <div className="reco2"></div>;
}

function Footer() {
  return <div className="background"></div>;
}

export default App;
